function customHook() {
	let [counter, setCounter] = useState(0);
	return [counter, setCounter];
}

const Test = () => {
	let [counter, setCounter] = customHook();

	return (
		<div className="App">
			<button onClick={() => setCounter(counter + 1)}>click</button>
		</div>
	);
};

export default Test;
